import styled from 'styled-components';

export interface Props {
    buttonType: 'primary' | 'secondary';
}

export const ButtonComponent = styled.button<Props>`
    background: ${(props: Props) =>
        props.buttonType === 'primary' ? '#F62459' : '#cccccc'
    };
    color: #fff;
`
